var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': '分組名單', 'text': '第 1 組成員: 40523120 倉儲 \xa0 | \xa0 40523120 網站 40723102 倉儲 \xa0 | \xa0 40723102 網站 40723110 倉儲 \xa0 | \xa0 40723110 網站 40723112 倉儲 \xa0 | \xa0 40723112 網站 40723115 倉儲 \xa0 | \xa0 40723115 網站 40723120 倉儲 \xa0 | \xa0 40723120 網站 40723127 倉儲 \xa0 | \xa0 40723127 網站 40723136 倉儲 \xa0 | \xa0 40723136 網站 40723140 倉儲 \xa0 | \xa0 40723140 網站 40723143 倉儲 \xa0 | \xa0 40723143 網站 40723146 倉儲 \xa0 | \xa0 40723146 網站 40723148 倉儲 \xa0 | \xa0 40723148 網站 \n', 'tags': '', 'url': '分組名單.html'}, {'title': 'Solvespace', 'text': 'Solvespace是一款容量小、免費、開源的繪圖軟體，打開後會有一大一小視窗，大視窗為主要繪圖，小視窗輔助作用。操作前請先確定在英打模式下比較容易使用快捷鍵操作。 \n', 'tags': '', 'url': 'Solvespace.html'}, {'title': 'Solvespace操作', 'text': '基本操作影片: \n \n 快捷鍵: \n \n 按住滑鼠中鍵(滾輪)-3D移動 \n 滑動滑鼠中鍵(滾輪)-放大縮小視窗 \n 按住滑鼠右鍵-平移 \n W-正投影 \n D-賦予尺寸(只能點一線或兩點或一點一線) \n N-角度 \n H-水平 \n V-垂直 \n O-重合共點 \n L-互相平行 \n [-互相垂直 \n S-線 \n G-切換線條 \n Shift+A-導角(點選兩條線之間結合的點) \n C-圓 \n A-三點定弧(有方向先後順序性) \n Shift+X-長料(小視窗可選擇單面或雙面) \n Shift+L-旋轉長料(小視窗可選擇單面或雙面) \n Shift+w-建立作圖平面(點選一點與滑鼠中鍵旋轉至大約面或兩線一點)[零件上繼續長料或除料用] \n \n 組合影片: \n \n 重點說明 : \n 1.當import下一個零件進來後，上一個零件就不能再定義 \n 2.import進的零件如果有需要定位移動可以畫線限制 \n ex\xa0Nutcracker 核桃碎殼器示範影片 \n \n', 'tags': '', 'url': 'Solvespace操作.html'}, {'title': 'Solvespace編譯', 'text': '下載可攜程式系統(並解壓縮): \n 2019Fall可攜套件.7z \n >>start_mdecourse.bat \n 編譯步驟: \n 檢查 Y:\\home_mdecourse\\.gitconfig\xa0 是否為ipv6 or ipv4 如在家中電腦大部分為ipv4網路(且要從虎科大校園網路登入SSL-VPN)\xa0 在proxy到系館ip才可正常運作 p.s如果沒有.gitconfig檔則自行創建 。 (ipv6 proxy = [2001:288:6004:XX::XX]:3128) \n \n 先將 Y:\\portablegit\\bin\\sh.exe 改名為 sh_rename_for_solvespace.exe (透過 MSYS2 執行 shell 指令, 而非 portablegit 中的 sh.exe) \n 開啟任意cmd視窗 \n git version 查驗 git 版本 \n git 2.13 版本以上, 可以使用下列 git clone \xa0 --recurse-submodules 取得所有子模組資料 \n git clone --recurse-submodules https://github.com/solvespace/solvespace.git solvespace \n \n edit Y:\\tmp\\40523120\\solvespace\\extlib\\angle\\CMakeLists.txt comment out line 713 and 714 \n #list(APPEND ANGLE_DEFINITIONS #"-DANGLE_PRELOADED_D3DCOMPILER_MODULE_NAMES={ \\"d3dcompiler_47.dll\\", \\"d3dcompiler_46.dll\\", \\"d3dcompiler_43.dll\\" }") endif() \n 接著需要手動進行 libpng.dll.a 的編譯, 並改名為 libpng_static.a, 並放到編譯系統的 lib 目錄中 (即隨身系統的 msys64\\mingw64\\lib 目錄): \n cd solvespace \n cd extlib \n cd libpng \n mkdir build \n cd build \n cmake .. -G "MinGW Makefiles" -DCMAKE_BUILD_TYPE=Release mingw32-make \n (mingw32-make -Wl,-static) \n rename libpng.dll.a to libpng_static.a and copy to Y:\\msys64\\mingw64\\lib \n 接著回到 solvespace 原始碼目錄, 建立 build 目錄後進入 build 目錄, 執行: \n cmake .. -G "MinGW Makefiles" -DCMAKE_BUILD_TYPE=Release \n \n 等待總是漫長~ \n 完成後\xa0 mingw32-make \n \n 全部編譯完成即可在windows開啟 solvespace 應用程式 \n \n 參考資料: \n https://2019wcm.blogspot.com/2019/03/msys2-solvespace.html \n https://github.com/solvespace/solvespace \n http://mde.tw/cad2019/content/Solvespace%20%E7%B7%A8%E8%AD%AF.html \n \n', 'tags': '', 'url': 'Solvespace編譯.html'}, {'title': 'V-rep', 'text': '最新改版為新的 CoppeliaSim \n 舊版v-rep仍可下載 \n 下載網站 http://www.coppeliarobotics.com/ \n', 'tags': '', 'url': 'V-rep.html'}, {'title': 'v-rep操作', 'text': '\n \n \n \n or 參考連桿機構影片 \n \n \n \n 一個零件可以拉很多馬達(旋轉軸)在他的支線底下但一個馬達只能拉一個零件在其支線下', 'tags': '', 'url': 'v-rep操作.html'}]};